import React, { useState } from 'react';
import './App.css';
import LoginSignUp from './Components/LoginSignUp/LoginSignUp';

function App() {
  const [showHi, setShowHi] = useState(true);

  return (
    <div>
      {showHi ? (
        <div style={{
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          height: '100vh',
          fontSize: '3rem'
        }}>
          Hi
        </div>
      ) : (
        <LoginSignUp />
      )}
    </div>
  );
}

export default App;
